import React, { Component } from 'react';
// import EntryApp from '../assets/videos/entry-app.mp4'
// import EntryPro from '../assets/videos/entry-prototype.mp4'
import '../App.css';

const PorscheShieldIcon = 'https://previews.dropbox.com/p/thumb/AAhfds81fGue9doCyGp6yAvM48S2UQuuRce4lP8oWrqoWHWG3LDxB6h1-Qx1zdnk3FwUX4iPWbaoJSw-tnjRnX-Qc2263MaOxPAaC23Lz3EjlLjEvCjLbH0cXpxkg8RQrBxPaqovqb4cvyIKmRp0BhbNl98jg_TRUc2bgwf2FFOi2oBwejZCdj2b7AXyXETFH-0_DAkEZ_llN6p3RyCk5hX3fHiAw2XFqu7iMtEGxT8_ipBhyCeecwFI_Z6Rh4f0W3QvQmYDWQhYyP13EUcbiAOCPSENX_s-O4nxvGJ4dp0WqgTsij-A1jEToJ2FByJXTaxySWGG8U5haQtWhGIXy9h9B0UpfKe3sbYZYlvTZTxCLvMneFOi4uypd4guZqM4BQQpizLCM1-uZKJE6Ld-8ZAUIxGtkPGbxBWSWvIZHQDMjImecPxajajqL2l8tUOdnuY/p.png'

var PorscheShieldImg = {
    backgroundRepeat: "no-repeat",
    backgroundPosition: "center",
    backgroundImage: `url(${PorscheShieldIcon})`,
    color: "black"
};

class PorschePortfolioRow extends Component {
    render() {
        return (
            <div className="cards-wrapper">
                <div
                    href="/"
                    id="vesselTrackerProject"
                    className="ux-column"
                    onClick={this.props.handleCardClick}
                    style={PorscheShieldImg}
                >
                    <h2>Vessel Tracker App</h2>
                </div>
                <div
                    href="/"
                    id="vt_PrototypeProject"
                    className="ux-column"
                    onClick={this.props.handleCardClick}
                    style={PorscheShieldImg}
                >
                    <h2>Vehicle Tracker Entrypoint</h2>
                </div>
            </div>
        )
    }
}

export default PorschePortfolioRow
